const reducer = (state = '', action) => {
    switch (action.type) {
        case "deposit":
            return state + action.payload;

        case "withdraw":
            return state - action.payload;

        case "success":
            alert('successfully logged in..... ');

        case "magaze":
            console.log('inside magaze', action.payload)
            state = action.payload;
            console.log('------', state)
            return state;

        default:
            return state
    }
};

export default reducer;
